from Crypto.Util.number import *
from flag import flag  # flag 是不存在的模块，你需要根据输出内容解出 flag

p = getPrime(512)
q = getPrime(512)
n = p * q
e = 65537
phi = (p - 1) * (q - 1)

m = bytes_to_long(flag)

c = pow(m, e, n)

print(f"p = {p}")
print(f"q = {q}")
print(f"e = {e}")
print(f"c = {c}")

